<p>在极限挑战S20E02的趣味挑战中，孙红雷、黄渤、罗志祥、黄磊、王迅和张艺兴这六位明星将参与一场名为“电击逃生”的紧张刺激游戏。他们被分成两组，每组拥有一辆装有模拟炸药的汽车。游戏的目标是通过接受电击来降低模拟炸药的爆炸概率，同时获得积分，电击的电压越大，爆炸概率越小，积分也越多。</p>
